import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

import CustomerLogin from './components/CustomerLogin';
import CustomerDashboard from './components/CustomerDashboard';
import AdminLogin from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';
import Logout from './components/Logout';
import AdminLogout from './components/AdminLogout';
import AdminCustomerAdd from './components/AdminCustomerAdd';
import AddCredit from './components/AddCredit';
import AdminAddDebit from './components/AddDebit';
import AdminCustomerList from './components/CustomerList';
import AdminCustomerDetails from './components/CustomerDetails';
import CustomerEdit from './components/CustomerEdit';
import CustomerCreditForm from './components/CustomerCreditForm';

// Private Route wrapper for admin
function AdminPrivateRoute({ children }) {
  const token = localStorage.getItem('adminToken');
  return token ? children : <Navigate to="/admin/login" />;
}

// Private Route wrapper for customer
function CustomerPrivateRoute({ children }) {
  const token = localStorage.getItem('token');
  const expiry = localStorage.getItem('tokenExpiry');
  if (token && expiry && Date.now() > parseInt(expiry, 10)) {
    localStorage.removeItem('token');
    localStorage.removeItem('tokenExpiry');
    return <Navigate to="/login" />;
  }
  return token ? children : <Navigate to="/login" />;
}

function App() {
  // Check if user is already logged in
  const customerToken = localStorage.getItem('token');
  const adminToken = localStorage.getItem('adminToken');

  return (
    <Routes>
      {/* Root redirect based on authentication */}
      <Route path="/" element={
        adminToken ? <Navigate to="/admin/dashboard" /> :
        customerToken ? <Navigate to="/dashboard" /> :
        <Navigate to="/login" />
      } />

      {/* Customer routes - removed 'customer' prefix */}
      <Route path="/login" element={<CustomerLogin />} />
      <Route path="/dashboard" element={<CustomerPrivateRoute><CustomerDashboard /></CustomerPrivateRoute>} />
      <Route path="/logout" element={<Logout />} />
      <Route path="/pay/:customerId" element={<CustomerPrivateRoute><CustomerCreditForm /></CustomerPrivateRoute>} />

      {/* Admin routes - kept under /admin */}
      <Route path="/admin/*" element={<AdminRoutes />} />

      {/* Redirect unknown routes to appropriate dashboard if logged in */}
      <Route path="*" element={
        adminToken ? <Navigate to="/admin/dashboard" /> :
        customerToken ? <Navigate to="/dashboard" /> :
        <Navigate to="/login" />
      } />
    </Routes>
  );
}

// Separate component for admin routes
function AdminRoutes() {
  return (
    <Routes>
      <Route path="login" element={<AdminLogin />} />
      <Route path="logout" element={<AdminLogout />} />
      <Route path="dashboard" element={<AdminPrivateRoute><AdminDashboard /></AdminPrivateRoute>} />
      <Route path="customers" element={<AdminPrivateRoute><AdminCustomerList /></AdminPrivateRoute>} />
      <Route path="customers/add" element={<AdminPrivateRoute><AdminCustomerAdd /></AdminPrivateRoute>} />
      <Route path="customers/:id" element={<AdminPrivateRoute><AdminCustomerDetails /></AdminPrivateRoute>} />
      <Route path="customers/:id/addcredit" element={<AdminPrivateRoute><AddCredit /></AdminPrivateRoute>} />
      <Route path="customers/:id/adddebit" element={<AdminPrivateRoute><AdminAddDebit /></AdminPrivateRoute>} />
      <Route path="customers/:id/edit" element={<AdminPrivateRoute><CustomerEdit /></AdminPrivateRoute>} />
    </Routes>
  );
}

export default App;
